import './Project.css';
import { useEffect } from 'react';
import { gsap } from 'gsap';


function Project({img, title}) {

    useEffect(() => { });

    return (
        <div className='project'>
            <img className='upsie project-image' src={img} />
            <div className='clipy'>
            <div className='upsie project-title'>{title}</div>
            </div>
        </div>
    );
}

export default Project;
